import React from 'react';

const MovieDetails = ({ movieInfo }) => {
  const { title, directors, openDt, showTm, genres } = movieInfo;

  return (
    <div>
      <h2>{title}</h2>
      <p>감독: {directors}</p>
      <p>개봉일: {openDt}</p>
      <p>상영시간: {showTm}</p>
      <p>장르: {genres}</p>
      {/* 추가적인 영화 상세 정보 표시 */}
    </div>
  );
};

export default MovieDetails;
